import React from "react";
import { Text } from "../components/atomes";

function Home() {
  return (
    <div>
      <header className="w-full h-20 bg-[#212121] flex flex-row justify-around items-center">
        <div>
          <Text.logo color={"#FFFFFF"} fontWeight={100}>
            Vins Montpelliérain
          </Text.logo>
        </div>
        <div className="flex flex-row items-center">
          <Text.sm fontSize>Accueil</Text.sm>
          <Text.sm fontSize>Boutique</Text.sm>
        </div>
        <div>
          <Text.h1>Vins Montpelliérain</Text.h1>
        </div>
      </header>
    </div>
  );
}

export default Home;
